import React from 'react';
import Header from './Component/Header/Header';
import Topbar from './Component/Navebar/Topbar/Topbar';
import './style.css';

function App() {
  return (
    <div className='app__Main'>
      <div className='app__Center'></div>
      <Topbar />
      <Header />
    </div>
  );
}

export default App;
